      out.write("					    console.log(\"저장할 장바구니 JSON:\", basketJson);\r\n");
      out.write("					    \r\n");
      out.write("					    document.cookie = \"basketItems=\" + basketJson + \"; path=/; max-age=86400\";\r\n");
      out.write("					    console.log(\"저장 후 전체 쿠키:\", document.cookie);\r\n");
      out.write("					    \r\n");
      out.write("					    // 저장 확인\r\n");
      out.write("					    let savedItems = getCookie(\"basketItems\");\r\n");
      out.write("					    console.log(\"저장된 장바구니 확인:\", savedItems);\r\n");
      out.write("					}\r\n");
      out.write("				    	// 장바구니 정보 출력 함수 수정\r\n");
      out.write("				    	function showBasketItems() {\r\n");
      out.write("				    	   console.log(\"=== 현재 장바구니 상태 ===\");\r\n");
      out.write("				    	   let items = getCookie(\"basketItems\");\r\n");
      out.write("				    	   \r\n");
      out.write("				    	   if(items) {\r\n");
      out.write("				    	       try {\r\n");
      out.write("				    	           let parsedItems = JSON.parse(items);\r\n");
      out.write("				    	           console.table(parsedItems);  // 테이블 형태로 예쁘게 출력\r\n");
      out.write("				    	           \r\n");
      out.write("				    	           parsedItems.forEach(item => {\r\n");
      out.write("				    	               console.log(\"=== 상품 상세 정보 ===\");\r\n");
      out.write("				    	               console.log(\"상품ID:\", item.id);\r\n");
      out.write("				    	               console.log(\"상품명:\", item.pname);\r\n");
      out.write("				    	               console.log(\"가격:\", parseInt(item.price).toLocaleString(), \"원\");\r\n");
      out.write("				    	               console.log(\"수량:\", item.quantity);\r\n");
      out.write("				    	               console.log(\"할인율:\", item.discountRate, \"%\");\r\n");
      out.write("				    	               console.log(\"이미지:\", item.imgUrl);\r\n");
      out.write("				    	               console.log(\"---------------\");\r\n");
      out.write("				    	           });\r\n");
      out.write("				    	           \r\n");
      out.write("				    	           let totalPrice = parsedItems.reduce((sum, item) => {\r\n");
      out.write("				    	               let price = parseInt(item.price);\r\n");
      out.write("				    	               let discount = item.discountRate > 0 ? price * (item.discountRate / 100) : 0;\r\n");
      out.write("				    	               return sum + ((price - discount) * item.quantity);\r\n");
      out.write("				    	           }, 0);\r\n");
      out.write("				    	               \r\n");
      out.write("				    	           console.log(\"총 상품 수:\", parsedItems.length);\r\n");
      out.write("				    	           console.log(\"총 금액:\", totalPrice.toLocaleString(), \"원\");\r\n");
      out.write("				    	           \r\n");
      out.write("				    	           return parsedItems;\r\n");
      out.write("				    	       } catch(e) {\r\n");
      out.write("				    	           console.error(\"장바구니 정보 확인 중 에러:\", e);\r\n");
      out.write("				    	           return [];\r\n");
      out.write("				    	       }\r\n");
      out.write("				    	   } else {\r\n");
      out.write("				    	       console.log(\"장바구니가 비어있습니다.\");\r\n");
      out.write("				    	       return [];\r\n");
      out.write("				    	   }\r\n");
      out.write("				    	}\r\n");
